	(83,69,'en_us','Threats section front',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Threats','<p>Leatherbacks face different threats specific to each stage of their lives and the habitats they occupy during those stages. To save the leatherback, we must reduce threats in all habitats turtles occupy across their entire life cycle.</p>',NULL,NULL,0,0,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,'<p>Leatherbacks face different threats specific to each stage of their lives and the habitats they occupy during those stages. To save the leatherback, we must reduce threats in all habitats turtles occupy across their entire life cycle.</p><p>For example, a nest that eludes poachers may produce a hatchling lucky enough to avoid ingesting plastics. The turtle will need to avoid entanglement in fishing gear as she migrates over long distances in search of jellyfish. After the 15-25 years, she will reach maturity and return to her natal beach to nest for the first time. Lights on the beach may prevent her from nesting – or if she does – disorient nestlings.</p><p>Lorem ipsum dolor dit amet adipiscing ultrices sit amet vel arcu. Fusce tellus lectus, rhoncus vel tortor id.</p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,0,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,0,'2014-07-27 20:47:31','2014-08-07 14:55:14','a185085d-e209-4973-97f3-069fcea27107'),
