	(179,131,'en_us','About section front',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,'','',NULL,NULL,'About','<p>Here\'s the teaser for the about section.</p>',NULL,NULL,0,0,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,'<p>The Leatherback Trust (TLT) is an international non-profit conservation organization devoted to preserving endangered leatherback turtles and other sea turtle species. In 2000, turtle biologists Jim Spotila and Frank Paladino founded TLT to engage local communities in protection of nesting beaches critical to saving leatherback turtles. While we continue to safeguard nesting beaches, we are now extending our focus beyond beaches to combat threats and protect sea turtles in the oceans. TLT’s reputation for integrity is grounded in data-driven scientific research and community action programs delivering measurable results.</p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,0,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,0,'2014-08-05 15:22:58','2014-08-12 21:32:34','995bbe0b-0eeb-46d0-a09e-c38b16e22946'),
	(180,131,'es','About section front',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Acerca','<p>Here\'s the spanish teaser for the about section</p>',NULL,NULL,0,0,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,'<p>(Spanish)&nbsp;The Leatherback Trust (TLT) is an international non-profit conservation organization devoted to preserving endangered leatherback turtles and other sea turtle species. In 2000, turtle biologists Jim Spotila and Frank Paladino founded TLT to engage local communities in protection of nesting beaches critical to saving leatherback turtles. While we continue to safeguard nesting beaches, we are now extending our focus beyond beaches to combat threats and protect sea turtles in the oceans. TLT’s reputation for integrity is grounded in data-driven scientific research and community action programs delivering measurable results.</p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,0,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,0,'2014-08-05 15:22:58','2014-08-12 21:32:43','149ab1f0-63cb-42fe-89a3-48b2c70f0fdd'),
