	(187,134,'en_us','History of TLT',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'History of TLT','<p>Teaser for the history page here.</p>',NULL,NULL,0,0,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,'<p>The Leatherback Trust is a non-profit foundation established by James R. Spotila, Ph.D. to save the leatherback turtle and other sea turtles from extinction. The Leatherback Trust scientists were instrumental in founding a new national park, Parque Marino Las Baulas, on the Pacific coast of Costa Rica. [WB]</p><p>The Leatherback Trust (TLT), established in 2000, is an international non-profit conservation organization devoted to preserving endangered leatherback turtles and other sea turtle species.</p><p>TLT applies a site-based approach to conservation centered actively on nesting beaches in Costa Rica and supporting research on beaches elsewhere globally. TLT uses an innovative, collaborative, and respectful approach to conservation, working with local communities to find win-win solutions for leatherback conservation. TLT has earned a reputation for integrity, through its emphasis on empirical work and its focus on action and results. We recognize the need and opportunity to expand beyond the beaches in order to address the other elements of sea turtle habitat critical to saving the turtles. These include inter-nesting areas, migration corridors and foraging areas.&nbsp;[SP]</p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,0,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,0,'2014-08-05 17:29:51','2014-08-07 15:00:09','eab7ed77-167f-4dc5-b922-78a18f848d3d'),
