	(195,142,'en_us','Why Leatherbacks section front',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Why Leatherbacks','<p>Teaser for the why leatherbacks section here.</p>',NULL,NULL,0,0,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,'<p>Sea turtles swam the oceans when dinosaurs roamed the earth. Early ocean explorers marveled at the abundance of sea turtles. [Add quote?] [Numbers afforded&hellip; Explorers / subsistence hunters collected eggs/ ate meat &hellip; human populations grew, sea turtle populations dwindled]. Now these ancient reptiles confront new threats, like pollution, industrial fishing, climate change, and large-scale coastal development.</p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,0,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,0,'2014-08-07 14:23:44','2014-08-12 21:33:15','c2263520-bdea-4468-b3d6-6fae33e5e6ec'),
