	(125,69,5,1,'es',1,'','{\"typeId\":\"6\",\"authorId\":null,\"title\":\"Threats section front\",\"slug\":\"threatsfront\",\"postDate\":1406494051,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"65\":\"<p>Leatherbacks face different threats specific to each stage of their lives and the habitats they occupy during those stages. To save the leatherback, we must reduce threats in all habitats turtles occupy across their entire life cycle.<\\/p><p>For example, a nest that eludes poachers may produce a hatchling lucky enough to avoid ingesting plastics. The turtle will need to avoid entanglement in fishing gear as she migrates over long distances in search of jellyfish. After the 15-25 years, she will reach maturity and return to her natal beach to nest for the first time. Lights on the beach may prevent her from nesting \\u2013 or if she does \\u2013 disorient nestlings.<\\/p><p>Lorem ipsum dolor dit amet adipiscing ultrices sit amet vel arcu. Fusce tellus lectus, rhoncus vel tortor id.<\\/p>\"}}','2014-07-27 20:58:06','2014-07-27 20:58:06','1581e396-6b5f-40bc-b4e7-90c67934cb4e'),
