	(282,143,15,1,'en_us',1,'','{\"typeId\":null,\"authorId\":\"1\",\"title\":\"Habits & Habitats\",\"slug\":\"habits-habitats\",\"postDate\":1407426238,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"23\":\"\",\"22\":\"\",\"20\":\"\",\"82\":\"\",\"26\":\"Habits & Habitats\",\"36\":{\"new1\":{\"type\":\"textBlock\",\"enabled\":\"1\",\"fields\":{\"text\":\"<p>There are seven species of sea turtle. All sea turtles share common life history characteristics, and face common threats throughout their lifetimes from nest disturbance, development, fishing, pollution and climate change. As the largest, deepest-diving and farthest ranging sea turtles, leatherbacks serve as a flagship species for the other six species of sea turtles negatively affected by climate change, beachfront lighting or unleashed pets disturbing nest sites. Charismatic leatherbacks can also raise awareness for other animals like albatross, which are also killed by plastic pollution, gillnets and longlines.<\\/p>\"}}},\"27\":\"<p>Here\'s a teaser for the habits and habitats page<\\/p>\",\"29\":\"\"}}','2014-08-07 15:43:59','2014-08-07 15:43:59','049406f1-f6ee-48f7-83e9-37c8786ba3e7'),
