	(353,131,11,1,'en_us',4,'','{\"typeId\":\"15\",\"authorId\":null,\"title\":\"About section front\",\"slug\":\"aboutfront\",\"postDate\":1407423617,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"65\":\"<p>The Leatherback Trust (TLT) is an international non-profit conservation organization devoted to preserving endangered leatherback turtles and other sea turtle species. In 2000, turtle biologists Jim Spotila and Frank Paladino founded TLT to engage local communities in protection of nesting beaches critical to saving leatherback turtles. While we continue to safeguard nesting beaches, we are now extending our focus beyond beaches to combat threats and protect sea turtles in the oceans. TLT\\u2019s reputation for integrity is grounded in data-driven scientific research and community action programs delivering measurable results.<\\/p>\",\"26\":\"About\",\"36\":{\"132\":{\"type\":\"textBlock\",\"enabled\":\"1\",\"fields\":{\"text\":\"<p>Here\'s the story content for the about section<\\/p>\"}}},\"27\":\"<p>Here\'s the teaser for the about section.<\\/p>\"}}','2014-08-12 21:30:59','2014-08-12 21:30:59','6d2e3e66-3b91-4ed0-9c46-829eac9bee01'),
