	(357,142,14,1,'en_us',2,'','{\"typeId\":\"21\",\"authorId\":null,\"title\":\"Why Leatherbacks section front\",\"slug\":\"whyleatherbacksfront\",\"postDate\":1407421424,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"65\":\"<p>Sea turtles swam the oceans when dinosaurs roamed the earth. Early ocean explorers marveled at the abundance of sea turtles. [Add quote?] [Numbers afforded&hellip; Explorers \\/ subsistence hunters collected eggs\\/ ate meat &hellip; human populations grew, sea turtle populations dwindled]. Now these ancient reptiles confront new threats, like pollution, industrial fishing, climate change, and large-scale coastal development.<\\/p>\",\"26\":\"Why Leatherbacks\",\"27\":\"<p>Teaser for the why leatherbacks section here.<\\/p>\"}}','2014-08-12 21:33:15','2014-08-12 21:33:15','921a6c38-3df0-4709-9c0d-bc26e88d1bbf'),
