	(46,141,'en_us',NULL,NULL,NULL,NULL,NULL,'Not until we are lost do we begin to understand ourselves.','Henry David Thoreau','',NULL,NULL,NULL,NULL,NULL,0.00000000,0.00000000,NULL,NULL,NULL,NULL,NULL,0,NULL,0,NULL,NULL,NULL,NULL,'2014-08-07 14:07:09','2014-08-07 14:14:51','6d70559b-de3e-4822-a840-e232852bcf16'),
	(47,144,'en_us','<p>There are seven species of sea turtle. All sea turtles share common life history characteristics, and face common threats throughout their lifetimes from nest disturbance, development, fishing, pollution and climate change. As the largest, deepest-diving and farthest ranging sea turtles, leatherbacks serve as a flagship species for the other six species of sea turtles negatively affected by climate change, beachfront lighting or unleashed pets disturbing nest sites. Charismatic leatherbacks can also raise awareness for other animals like albatross, which are also killed by plastic pollution, gillnets and longlines.</p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0.00000000,0.00000000,NULL,NULL,NULL,NULL,NULL,0,NULL,0,NULL,NULL,NULL,NULL,'2014-08-07 15:43:59','2014-08-12 21:09:07','83febc96-d732-4772-a1a3-4198463dff4d'),
	(48,145,'es','<p>(Spanish)&nbsp;There are seven species of sea turtle. All sea turtles share common life history characteristics, and face common threats throughout their lifetimes from nest disturbance, development, fishing, pollution and climate change. As the largest, deepest-diving and farthest ranging sea turtles, leatherbacks serve as a flagship species for the other six species of sea turtles negatively affected by climate change, beachfront lighting or unleashed pets disturbing nest sites. Charismatic leatherbacks can also raise awareness for other animals like albatross, which are also killed by plastic pollution, gillnets and longlines.</p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0.00000000,0.00000000,NULL,NULL,NULL,NULL,NULL,0,NULL,0,NULL,NULL,NULL,NULL,'2014-08-07 15:45:21','2014-08-07 15:45:21','ffabfa1b-7ffa-4146-baff-077bc96fff07'),
	(50,150,'en_us','<p>Sea turtles swam the oceans when dinosaurs roamed the earth. Early ocean explorers marveled at the abundance of sea turtles. [Add quote?] [Numbers afforded&hellip; Explorers / subsistence hunters collected eggs/ ate meat &hellip; human populations grew, sea turtle populations dwindled]. Now these ancient reptiles confront new threats, like pollution, industrial fishing, climate change, and large-scale coastal development.</p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0.00000000,0.00000000,NULL,NULL,NULL,NULL,NULL,0,NULL,0,NULL,NULL,NULL,NULL,'2014-08-07 16:14:48','2014-08-12 21:40:29','5392846d-694e-45ed-96fd-40426367359f'),
	(51,151,'es','<p>Spanish story block content for this page is here.</p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0.00000000,0.00000000,NULL,NULL,NULL,NULL,NULL,0,NULL,0,NULL,NULL,NULL,NULL,'2014-08-07 16:16:21','2014-08-07 16:16:21','72679ffc-42d9-42a3-9dd7-e0047e9baae1'),
	(52,152,'en_us',NULL,'jumbo','','<p>Historical engravings of leatherbacks leave something to be desired as to the accuracy of the representation. However, they teach us that humans have been observing leatherbacks for hundreds of years.</p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0.00000000,0.00000000,NULL,NULL,NULL,NULL,NULL,0,NULL,0,NULL,NULL,NULL,NULL,'2014-08-07 16:18:57','2014-08-12 21:40:29','8681fe6d-19f6-4fe4-afff-0575284e7404'),
