	(134,'field',65,'en_us',' the leatherback trust is a non profit foundation established by james r spotila ph d to save the leatherback turtle and other sea turtles from extinction the leatherback trust scientists were instrumental in founding a new national park parque marino las baulas on the pacific coast of costa rica wb the leatherback trust tlt established in 2000 is an international non profit conservation organization devoted to preserving endangered leatherback turtles and other sea turtle species tlt applies a site based approach to conservation centered actively on nesting beaches in costa rica and supporting research on beaches elsewhere globally tlt uses an innovative collaborative and respectful approach to conservation working with local communities to find win win solutions for leatherback conservation tlt has earned a reputation for integrity through its emphasis on empirical work and its focus on action and results we recognize the need and opportunity to expand beyond the beaches in order to address the other elements of sea turtle habitat critical to saving the turtles these include inter nesting areas migration corridors and foraging areas sp '),
